import { Container, Button
} from 'react-bootstrap';

export const NotFound = () => {
  return (
    <main role="main">
      <div className="jumbotron-fluid">
      <h1>404 - Page Not Found</h1>
      <Container className="blockquote">
        <Container fluid className="bg-primary" style={{ padding: 50 }}>
          <Container className="bg-light" style={{ padding: 50 }}>
            <blockquote className="blockquote mb-0">
            <h3 className="font-italic">"Not all those who wander are lost."</h3>
            <h3 className="blockquote-footer">J.R.R. Tolkien, The Fellowship of the Ring</h3>
            </blockquote>
          </Container>
        </Container>
        <h2>But you might be. <br />
        <Button size="lg" href="/">Go back Home</Button></h2>
      </Container>
      </div>
    </main>
  );
}
